function toOct(n: number): string {
  if ((n == 0)) {
    return "0";
  }
  const digits: string = "01234567";
  let out: string = "";
  let v: number = n;
  while ((v > 0)) {
    const d: number = (v % 8);
    out = (digits.slice(d, (d + 1)) + out);
    v = Math.trunc(v / 8);
  }
  return out;
}
